import { Children } from "react";

import styled from "styled-components";

const Row = styled.div`
  border-bottom: 1px solid red;
  border-left: 1px solid red;
  border-right: 1px solid red;
  display: flex;
  align-items: center;
  padding: 20px;
  width: 1005;
  &:first-child {
    border-top: 1px solid red;
  }
`;

export default Row;
